import EmailComponent from "./Components/EmailComponent/EmailComponent";
import PasswordComponent from "./Components/EmailComponent/PasswordComponent";
import "./App.css";

function App() {
  return (
    <div className="App">
      <EmailComponent />
      <PasswordComponent />
    </div>
  );
}

export default App;
